#####Entry
# ###



# https://coral.ai/docs/m2/get-started/#2a-on-linux
# 
# https://stackoverflow.com/questions/1884753/license-info-of-a-deb-package
#  'dpkg-deb --fsys-tarfile foo.deb |tar -xvO ./usr/share/doc/foo/copyright'
# /var/cache/apt/archives
# gasket-dkms libedgetpu1-std
_install_tpu() {
	_messageNormal 'init: _install_tpu'

	_messagePlain_probe 'repo: coral-edgetpu-stable'
	echo "deb https://packages.cloud.google.com/apt coral-edgetpu-stable main" | sudo -n tee /etc/apt/sources.list.d/coral-edgetpu.list > /dev/null
	_messagePlain_probe 'repo: coral-edgetpu-stable: apt-key'
	curl https://packages.cloud.google.com/apt/doc/apt-key.gpg | sudo -n apt-key add -
	_messagePlain_probe 'repo: coral-edgetpu-stable: apt-get update'
	sudo -n env DEBIAN_FRONTEND=noninteractive apt-get -y update

	_messagePlain_probe 'apt-get install: gasket-dkms libedgetpu1-std'
	sudo -n env DEBIAN_FRONTEND=noninteractive apt-get install --install-recommends -y gasket-dkms libedgetpu1-std

	_messagePlain_probe 'udev rules'
	sudo -n sh -c "echo 'SUBSYSTEM==\"apex\", MODE=\"0660\", GROUP=\"apex\"' >> /etc/udev/rules.d/65-apex.rules"

	sudo -n groupadd apex

	sudo -n adduser $USER apex



	_messagePlain_request 'request: reboot, check devices:'
	_messagePlain_request 'lspci -nn | grep 089a'
	#03:00.0 System peripheral: Device 1ac1:089a
	_messagePlain_request 'ls -l /dev/apex_0'
	#/dev/apex_0
}


# Container Toolkit, NOT Drivers
# https://docs.nvidia.com/datacenter/cloud-native/container-toolkit/latest/install-guide.html#configuring-docker
# 
# https://stackoverflow.com/questions/1884753/license-info-of-a-deb-package
#  'dpkg-deb --fsys-tarfile foo.deb |tar -xvO ./usr/share/doc/foo/copyright'
# libnvidia-container-tools libnvidia-container1 nvidia-container-toolkit nvidia-container-toolkit-base
_install_nv_container_toolkit() {
	_messageNormal 'init: _install_nv_container_toolkit'

	_messagePlain_probe 'repo: nvidia-container-toolkit'
	# --status-fd --with-colons
	curl -fsSL https://nvidia.github.io/libnvidia-container/gpgkey | sudo -n gpg --batch --yes --dearmor -o /usr/share/keyrings/nvidia-container-toolkit-keyring.gpg \
  && curl -s -L https://nvidia.github.io/libnvidia-container/stable/deb/nvidia-container-toolkit.list | \
    sed 's#deb https://#deb [signed-by=/usr/share/keyrings/nvidia-container-toolkit-keyring.gpg] https://#g' | \
    sudo -n tee /etc/apt/sources.list.d/nvidia-container-toolkit.list

	# Discouraged.
	#sed -i -e '/experimental/ s/^#//g' /etc/apt/sources.list.d/nvidia-container-toolkit.list

	_messagePlain_probe 'repo: nvidia-container-toolkit: apt-get update'
	sudo -n env DEBIAN_FRONTEND=noninteractive apt-get -y update

	_messagePlain_probe 'apt-get install: nvidia-container-toolkit'
	sudo -n env DEBIAN_FRONTEND=noninteractive apt-get install --install-recommends -y nvidia-container-toolkit



	_messagePlain_probe 'nvidia-ctk runtime configure'
	sudo -n nvidia-ctk runtime configure --runtime=docker

	_messagePlain_probe 'systemctl restart docker'
	sudo -n systemctl restart docker


	_messagePlain_request 'request: check /etc/docker/daemon.json'
}




